import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <Router>
      <Navbar />
      <Sidebar />
      <MainContainer>
        <Routes>
          <Route path="/" element={<Navigate to="/profile/12" />} />
          <Route path="/profile/:id" element={<Profile />} />
        </Routes>
      </MainContainer>
    </Router>
  );
}

export default App;
